import React from 'react';

import { Card } from 'semantic-ui-react';
import { withRouter } from 'react-router';
import Axios from 'axios';




const DoctorCard = ({
  place_id,
  name,
  vicinity,
  opening_hours,
  rating,
  user_ratings_total,
  phone,
  photos,
  history
}) => {
  const getPlaceDetails = async (e) => {
    const res = await Axios.get(`http://localhost:3000/doctors/details/${place_id}`)
    history.push(`/doctors/`)

  };
  return (
    <Card onClick={(e) => getPlaceDetails(e)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
      <Card.Content>
        {vicinity}

        <Card.Meta>{phone}</Card.Meta>
        <span>Rating: {rating}</span>
      </Card.Content>
    </Card>
  );
};

export default withRouter(DoctorCard);
